/*Table structure for table `request_proposal_approvals` */

DROP TABLE IF EXISTS `request_proposal_approvals`;

CREATE TABLE `request_proposal_approvals` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `request_proposal_id` bigint(20) unsigned NOT NULL,
  `user_id` bigint(20) unsigned NOT NULL,
  `priority` int(11) NOT NULL DEFAULT '1',
  `response` enum('pending','approved','denied') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'approved',
  `logs` longtext COLLATE utf8mb4_unicode_ci,
  `created_by` bigint(20) unsigned NOT NULL,
  `updated_by` bigint(20) unsigned DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `request_proposal_approvals_request_proposal_id_foreign` (`request_proposal_id`),
  KEY `request_proposal_approvals_user_id_foreign` (`user_id`),
  KEY `request_proposal_approvals_created_by_foreign` (`created_by`),
  KEY `request_proposal_approvals_updated_by_foreign` (`updated_by`),
  CONSTRAINT `request_proposal_approvals_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `request_proposal_approvals_request_proposal_id_foreign` FOREIGN KEY (`request_proposal_id`) REFERENCES `request_proposals` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `request_proposal_approvals_updated_by_foreign` FOREIGN KEY (`updated_by`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `request_proposal_approvals_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=104 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

