insert  into `system_information`(`id`,`organization`,`name`,`description`,`phone`,`mobile`,`address`,`email`,`website`,`twitter`,`facebook`,`instagram`,`skype`,`linked_in`,`resend_limit`,`logo`,`secondary_logo`,`icon`,`pad`,`general_conditions`,`created_at`,`updated_at`) values (1,'Bizz Solutions PLC','BizzPack','<a href=\"https://bizzsol.com.bd/\">Bizz Solutions PLC</a>',NULL,NULL,NULL,'info@bizzsol.com.bd',NULL,NULL,NULL,NULL,NULL,NULL,0,'upload/system-images/logos/2024/02/13/299130224102420.png','upload/system-images/secondary-logos/2024/02/13/122130224102420.png','upload/system-images/icons/2024/02/12/967120224102133.png','upload/system-images/pads/2024/05/09/158090524101625.png','<ol>\r\n	<li><strong>Acceptance:</strong><br />\r\n	Acceptance of this purchase order shall be subject to all of the terms and conditions herein and constitute entire agreement of the parties and supersede all previous verbal or written representations, agreement and conditions. Any attempt to strike out or alter the terms hereof shall not be deemed an acceptance, but a rejection of the offer contained herein and a new offer by the seller, which must be expressly accepted by us in writing to be effective.</li>\r\n	<li><strong>Delivery:</strong><br />\r\n	Time and rate of deliveries are of essence on this order. Buyer reserves the right to cancel the order and reject the goods upon default by seller in time rate of delivery, or buyer at its option may approve in writing a revised delivery schedule.</li>\r\n	<li><strong>Assignment:</strong><br />\r\n	Seller shall not assign this order or interests therein, nor subcontract any portion of the work to be performed without buyer&#39;s prior written consent.</li>\r\n	<li><strong>Prices:</strong><br />\r\n	In the event that this order does not state price or term of delivery buyer will not be bound to any prices or delivery to which it has not specifically in writing.</li>\r\n	<li><strong>VAT and Taxes:</strong><br />\r\n	Supplier must attach relevant documents with invoices if the price is inclusive of VAT or Tax, otherwise the buyer may deduct them from the invoice value.</li>\r\n	<li><strong>Inspection:</strong><br />\r\n	SSL reserves the right to inspect the supplies called for under this contract at any time and the seller will afford every facility for such inspection.</li>\r\n	<li><strong>Packing:</strong><br />\r\n	The firm will pack the goods with the best materials and with very care in accordance with the normal commercial standards of packing for this type of merchandise. Such packing materials used must be adequate to safeguard the goods while in transit. The seller will be responsible for any damage or loss, which can be shown to have resulted from faulty and inadequate packing.</li>\r\n	<li><strong>Rejection/Cancellation:</strong><br />\r\n	If any supplies are defective in material or workmanship or not in conformity with the requirements of the order or not as per sample, buyer shall have the right to reject the same or require that such supplies be corrected or repaired with satisfactory material or workmanship. Buyer has the right to cancel the order in delivery are not made as per specification.</li>\r\n	<li><strong>Delivery Delays:</strong><br />\r\n	Delays beyond the agreed schedule will be excused only if due to unforeseeable causes beyond the control and without the fault or negligence of seller, and if seller notifies buyer in writing of the causes of such delay within reasonable time from the beginning thereof.</li>\r\n	<li><strong>Force Majeure:</strong><br />\r\n	Neither party to the contract shall be held responsibility for delay in the fulfillment thereof due to force majeure, strikes, lockout, war, civil unrest, or other factors outside its control.</li>\r\n	<li><strong>Export License:</strong><br />\r\n	The contract is subject to the obtaining of any import license or other governmental authorization, which may be necessary. It will be the responsibility of the vendor to obtain such license or authorization, but buyer will do everything in its power to assist.</li>\r\n	<li><strong>Default:</strong><br />\r\n	In the case of default of the contractor, including but not limited to failure or refusal to make deliveries within the time specified, buyer may be in written notice terminate the right of the contractor to proceed with deliveries of such part or parts thereof as to which there has been default.</li>\r\n	<li><strong>Arbitration Clause:</strong><br />\r\n	Any claim or dispute arising out of the present contract or breach of the said contract, and which cannot be settled amicably, shall be settled by arbitration, the methods of such arbitration to be agreed between the parties.</li>\r\n</ol>',NULL,'2024-06-08 12:22:23');

