/*Table structure for table `user_cost_centres` */

DROP TABLE IF EXISTS `user_cost_centres`;

CREATE TABLE `user_cost_centres` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `cost_centre_id` bigint(20) unsigned NOT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_cost_centres_user_id_foreign` (`user_id`),
  KEY `user_cost_centres_cost_centre_id_foreign` (`cost_centre_id`),
  CONSTRAINT `user_cost_centres_cost_centre_id_foreign` FOREIGN KEY (`cost_centre_id`) REFERENCES `cost_centres` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_cost_centres_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=18293 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

